import React from 'react';
import './Header.css';
import logo from './img/logo-dm.png';

const LanguageSelector = () => {

    return (
        <li>
            <a href="/">
                <span className="flag-icon"></span>
            </a>

            <div className="">
                <a href="#en">
                    <span className="flag-icon"></span>English
                </a>
                <a href="#es">
                    <span className="flag-icon"></span>Espa&ntilde;ol
                </a>
                <a href="#pt">
                    <span className="flag-icon"></span>Portugu&ecirc;s
                </a>
            </div>
        </li>
    );
}

const NavigationBar = () => {

    return (
        <nav>
            <ul>
                <li>
                    <a className="" href="#about">a</a>
                </li>
                <li>
                    <a className="" href="#wallet">a</a>
                </li>
                <li>
                    <a className="" href="#whitepaper">a</a>
                </li>
                <li>
                    <a className="" href="#roadmap">a</a>
                </li>
                <li>
                    <a className="" href="#financing">a</a>
                </li>
                <li>
                    <a className="" href="#faq">a</a>
                </li>

                <LanguageSelector />
            </ul>
        </nav>
    );
}

const PageLogo = () => {

    return (
        <a href="/">
            <img src={logo} alt="Logo" />
        </a>
    );
}

class Header extends React.Component {

    render() {
        return (
            <header>
                <div className="container">
                    <PageLogo />
                    <button className="burgerBtn">&equiv;</button>
                    <NavigationBar />
                </div>
            </header>
        );
    }
}

export default Header;
